import { createRouter, createWebHistory } from "vue-router";
import ContactView from "../views/ContactView.vue";

const routes = [
  {
    path: "/",
    name: "home",
    component: ContactView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
